import ExpenseItem from "./components/Expenses";

function App() {
  const expenses = [
    { id: 'e1', title: "Toilette Paper", amount: 294.67, date: new Date(2021, 1, 25) },
    { id: 'e2', title: "New TV", amount: 294.67, date: new Date(2021, 2, 28) },
    { id: 'e3', title: "Car Insurance", amount: 294.67, date: new Date(2021, 7, 12) },
    { id: 'e4', title: "New Desktop", amount: 294.67, date: new Date(2021, 2, 6) },
  ];

  return (
    <div>
      <h1>Prima applicazione con React!</h1>
      <div className="expense-item">
        <Expenses title={expenses[0].title} amount={expenses[0].amount} date={expenses[0].date}/>
        <Expenses title={expenses[1].title} amount={expenses[1].amount} date={expenses[1].date}/>
        <Expenses title={expenses[2].title} amount={expenses[2].amount} date={expenses[2].date}/>
        <Expenses title={expenses[3].title} amount={expenses[3].amount} date={expenses[3].date}/>
      </div>
    </div>
  );
}

export default App;
